function convertToNormalizedParameterValue(index, value) {
    switch (index) {
    case 4:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));
            let normalizedValue = (value - 0) / (1 - 0);
            return normalizedValue;
        }
    case 2:
    case 3:
        {
            value = (value < 0 ? 0 : (value > 0.5 ? 0.5 : value));
            let normalizedValue = (value - 0) / (0.5 - 0);
            return normalizedValue;
        }
    case 0:
    case 1:
        {
            value = (value < 220 ? 220 : (value > 440 ? 440 : value));
            let normalizedValue = (value - 220) / (440 - 220);
            return normalizedValue;
        }
    default:
        return value;
    }
}

